pragma solidity ^0.5.0;

contract DStorage {
  string public name = 'DStorage';
  uint public fileCount = 0;
  mapping(uint => File) public files;
  mapping (string => uint256) documents;
  mapping (string => address payable) filesigner;
    mapping (string => string) filereceiver;

  uint256 x;


struct File {
    uint fileId;
    string fileHash;
    uint fileSize;
    string fileType;
    string fileName;
    string fileDescription;
    uint uploadTime;
    address payable uploader;
  }

  event FileUploaded(
    uint fileId,
    string fileHash,
    uint fileSize,
    string fileType,
    string fileName, 
    string fileDescription,
    uint uploadTime,
    address payable uploader
  );

  constructor() public {
  }

  function uploadFile(string memory _fileHash, uint _fileSize, string memory _fileType, string memory _fileName, 
  string memory _fileDescription) public {
    // Make sure the file hash exists
    require(bytes(_fileHash).length > 0);
    // Make sure file type exists
    require(bytes(_fileType).length > 0);
    // Make sure file description exists
    require(bytes(_fileDescription).length > 0);
    // Make sure file fileName exists
    require(bytes(_fileName).length > 0);
    // Make sure uploader address exists
    require(msg.sender!=address(0));
    // Make sure file size is more than 0
    require(_fileSize>0);

    // Increment file id
    fileCount ++;

    uint256 timeAdded = block.timestamp;
    documents[_fileHash] = timeAdded;

    filesigner[_fileHash] = msg.sender;

    filereceiver[_fileHash]= _fileDescription;

    // Add File to the contract
    files[fileCount] = File(fileCount, _fileHash, _fileSize, _fileType, _fileName, _fileDescription, now, msg.sender);
    // Trigger an event
    emit FileUploaded(fileCount, _fileHash, _fileSize, _fileType, _fileName, _fileDescription, now, msg.sender);
  }

  function set(string memory _fileHash) public {
    x = documents[_fileHash];
  }

  function get() public view returns (uint256 dateAdded){
     return x;
     }

  function verify(string memory _fileHash) view public returns (uint256 dateAdded){
     return documents[_fileHash];
     }

     function getsigner(string memory _fileHash) view public returns (address payable){
     return filesigner[_fileHash];
     }

     function getreceiver(string memory _fileHash) view public returns (string memory){
     return filereceiver[_fileHash];
     }

}
